  public static int lengthOfLongestSubstring(String s) {
    Map<Character, Integer> map = new HashMap<>(256);
    int left = 0;
    int right = 0;
    int max = 0;

    while (right <= s.length() - 1) {
      char key = s.charAt(right);
      Integer oldVal = map.get(key);
      if (oldVal == null) {
        map.put(key, right);
      } else {
        if (oldVal + 1 > left) {
          left = oldVal + 1;
        }
        map.put(key, right);
      }
      max = Math.max(max, right - left + 1);
      ++right;
    }

    return max;
  }

